import React from 'react';

import './Footer.scss';

import iconAddFiles from './svg/1.svg';

const Footer = () => {
	return (
    <div className="wrapper-footer">
	 		<img src={iconAddFiles} className="" alt="iconAddFiles"/>
		</div>
	);
};

export default Footer;
